from heapq import heappush, heappop
from collections import defaultdict
best = set()
def parse_maze(input_data):
    maze = [list(line) for line in input_data.splitlines()]
    start, end = None, None
    for r, row in enumerate(maze):
        for c, char in enumerate(row):
            if char == 'S':
                start = (r, c)
            elif char == 'E':
                end = (r, c)
    return maze, start, end
mincost = 99999999999
def reindeer_maze(input_data):
    global best, mincost
    # Parse the maze and find the start and end
    maze, start, end = parse_maze(input_data)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]  # East, South, West, North
    direction_cost = 1000
    coststore = defaultdict(int)
    ways = defaultdict(int)
    # Priority queue for BFS/Dijkstra
    pq = []
    heappush(pq, (0, start[0], start[1], 0, set()))  # (cost, row, col, direction)
    # visited = set()
    ccc = 0
    for i in range(0,999):
        for j in range(999):
            for k in range(4):
                coststore[(i,j,k)] = 9999999999999
    while pq:
        print(len(pq))
        cost, r, c, d, path = heappop(pq)
        # Goal check
        if (r, c) == end:
            print(path)
            pathpos = set()
            for i in path:
                pathpos.add(i[:2])
            if cost < mincost:
                mincost = cost
                best = pathpos.copy()
                ccc += 1
            elif cost == mincost:
                best = best.union(pathpos) 
                ccc += 1
        # Skip already visited states
        if (r, c,d) in path or cost > coststore[(r,c,d)]:
            continue
        path.add((r, c,d))
        coststore[(r,c,d)] = min(coststore[(r,c,d)], cost)
        # Try moving forward
        dr, dc = directions[d]
        nr, nc = r + dr, c + dc
        if maze[nr][nc] != '#':
            heappush(pq, (cost + 1, nr, nc, d, path.copy()))

        # Try rotating (clockwise and counterclockwise)
        for nd in [(d + 1) % 4, (d - 1) % 4]:
            heappush(pq, (cost + direction_cost, r, c, nd,path.copy()))
    print(ccc, mincost)
    print(ways[end])
    return mincost  # If no path found

